import React from "react";
import { UserIcon } from "./Icons";

export const Header = () => (
    <div>
        <a href="./">Q & A</a>
        <input type="text" placeholder="searching" />
        <a href="./signing">
            <span>Sign In</span>
        </a>
        <UserIcon />
    </div>
);
